import React from "react";
import { Image, Text } from "react-native";
import { View } from "react-native-web";
import { StyleSheet } from "react-native";
import Home from "./src/Screen/HomePage";
import About from "./src/Screen/About";
import Course from "./src/Screen/Course";
import Contact from "./src/Screen/Contact";
import UserData from "./src/Screen/UserData";
import { NavigationContainer } from "@react-navigation/native";
import { createNativeStackNavigator } from "@react-navigation/native-stack";
import CourseDetail from "./src/Screen/CourseDetail";
const Stack = createNativeStackNavigator();
const App = () => {
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="home">
        <Stack.Screen
          name="home"
          component={Home}
          options={{ headerShown: false }}
        />
        {/* <Stack.Screen  name="Home" >
      { (props)=> { <Home {...props} chanelName = {"TopG-RoboLab"} />  }  }
      </Stack.Screen> */}
        <Stack.Screen
          name="about"
          component={About}
          options={{
            headerTitleStyle: {
              fontSize: 20,
            },
            headerTitleAlign: "center",
            headerTitle: "About",
          }}
        />
        <Stack.Screen name="course" component={Course}    options={{
            headerTitleStyle: {
              fontSize: 20,
            },
            headerTitleAlign: "center",
            headerTitle: "Course",
          }} />
        <Stack.Screen name="courseDetails" component={CourseDetail}    options={{
            headerTitleStyle: {
              fontSize: 20,
            },
            headerTitleAlign: "center",
            headerTitle: "CourseDetail",
          }} />
        <Stack.Screen name="contact" component={Contact}    options={{
            headerTitleStyle: {
              fontSize: 20,
            },
            headerTitleAlign: "center",
            headerTitle: "Contact",
          }} />
        <Stack.Screen name="student" component={UserData}    options={{
            headerTitleStyle: {
              fontSize: 20,
            },
            headerTitleAlign: "center",
            headerTitle: "Student Data",
          }} />
      </Stack.Navigator>
    </NavigationContainer>
  );
};

export default App;
